// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./libraries/Types.sol";
import "./libraries/LibSessionReceipt.sol";
import "../interfaces/INodesStorage.sol";
import "../interfaces/IUsageDepositor.sol";

contract SessionReceipt is ReentrancyGuard, Ownable {
    INodesStorage public nodesStorage;
    IUsageDepositor public usageDepositor;

    mapping(address => mapping(uint256 => LibSessionReceipt.SessionReceipt))
        private sessionsReceipts;
    mapping(address => uint256) private nonces;

    event SessionReceiptCreated(
        address client,
        address node,
        uint256 totalSecondsServed,
        address tokenAddress,
        uint256 totalPrice
    );

    event SessionReceiptConfirmed(address client, address node, uint256 nonce);

    modifier onlyValidNode() {
        require(
            nodesStorage.isValidNode(msg.sender),
            "Node is not whitelisted"
        );
        _;
    }

    constructor(address _nodesStorage, address _usageDepositor) {
        nodesStorage = INodesStorage(_nodesStorage);
        usageDepositor = IUsageDepositor(_usageDepositor);
    }

    function getSessionReceipt(
        address client,
        uint256 nonce
    ) external view returns (LibSessionReceipt.SessionReceipt memory) {
        return sessionsReceipts[client][nonce];
    }

    function getNonce(address client) external view returns (uint256) {
        return nonces[client];
    }

    function getLatestReceipt(
        address client
    ) public view returns (LibSessionReceipt.SessionReceipt memory receipt) {
        uint256 latestReceiptNonce = nonces[client] - 1;
        receipt = sessionsReceipts[client][latestReceiptNonce];
    }

    function createSessionReceipt(
        address client,
        uint256 totalSecondsServed,
        address tokenAddress,
        TokenType tokenType,
        uint256 pricePerSecond,
        uint256 nonce
    ) external nonReentrant onlyValidNode {
        require(nonce == nonces[client], "Invalid nonce");

        uint256 totalPrice = totalSecondsServed * pricePerSecond;

        LibSessionReceipt.SessionReceipt
            memory sessionReceipt = LibSessionReceipt.SessionReceipt({
                client: client,
                node: msg.sender,
                totalSecondsServed: totalSecondsServed,
                tokenType: tokenType,
                tokenAddress: tokenAddress,
                status: LibSessionReceipt.SessionReceiptStatus.PENDING,
                totalPrice: totalPrice,
                nonce: nonce
            });

        sessionsReceipts[client][nonce] = sessionReceipt;
        nonces[client]++;

        emit SessionReceiptCreated(
            client,
            msg.sender,
            totalSecondsServed,
            tokenAddress,
            totalPrice
        );
    }

    function confirmSessionReceipt(uint256 nonce) external nonReentrant {
        LibSessionReceipt.SessionReceipt
            storage sessionReceipt = sessionsReceipts[msg.sender][nonce];

        require(
            sessionReceipt.status ==
                LibSessionReceipt.SessionReceiptStatus.PENDING,
            "Session receipt is not pending"
        );

        sessionReceipt.status = LibSessionReceipt
            .SessionReceiptStatus
            .CONFIRMED;

        emit SessionReceiptConfirmed(
            sessionReceipt.client,
            sessionReceipt.node,
            sessionReceipt.nonce
        );
    }

    function redeemReceipt(
        address client,
        uint256 nonce
    ) external onlyValidNode nonReentrant {
        LibSessionReceipt.SessionReceipt
            storage sessionReceipt = sessionsReceipts[client][nonce];

        require(
            sessionReceipt.status ==
                LibSessionReceipt.SessionReceiptStatus.CONFIRMED,
            "Session receipt is not confirmed"
        );
        require(
            sessionReceipt.node == msg.sender,
            "Sender is not node in session's receipt"
        );

        // Move external call before the state update
        usageDepositor.settleUsageToNode(
            sessionReceipt.client,
            sessionReceipt.node,
            sessionReceipt.totalSecondsServed,
            sessionReceipt.tokenAddress,
            sessionReceipt.totalPrice
        );

        sessionReceipt.status = LibSessionReceipt.SessionReceiptStatus.PAID;
    }
}

contracts/payment/UsageDepositor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./libraries/Types.sol";
import "./libraries/LibUsageOrder.sol";
import "./libraries/LibSessionReceipt.sol";
import "./UsageOrderValidator.sol";
import "../interfaces/INodesStorage.sol";

contract UsageDepositor is ReentrancyGuard, Ownable, UsageOrderValidator {
    using SafeERC20 for IERC20;

    INodesStorage private nodesStorage;

    address private usageBillingAdmin;
    address private sessionReceiptContract;

    mapping(address => bool) private whitelistedTokens;
    mapping(address => uint256) private tokenBalances;
    mapping(address => uint256) private clientUsages;
    mapping(address => uint256) private nonces;

    event UsagePurchased(address client, uint256 totalPrice, uint256 usage);
    event UsageSettledToNode(
        address client,
        address node,
        uint256 totalServedUsage,
        uint256 totalToken
    );

    modifier onlySessionReceiptContract() {
        require(
            msg.sender == sessionReceiptContract,
            "Only SessionReceiptContract can call this function"
        );
        _;
    }

    constructor(
        address _usageBillingAdmin,
        address _sessionReceiptContract,
        address _nodesStorage
    ) UsageOrderValidator("UsageDepositor", "1") {
        usageBillingAdmin = _usageBillingAdmin;
        sessionReceiptContract = _sessionReceiptContract;
        nodesStorage = INodesStorage(_nodesStorage);
    }

    function getNonce(address client) public view returns (uint256) {
        return nonces[client];
    }

    function getClientUsage(address client) public view returns (uint256) {
        return clientUsages[client];
    }

    function setUsageBillingAdmin(address _usageBillingAdmin) public onlyOwner {
        require(
            _usageBillingAdmin != address(0),
            "Invalid usage billing admin"
        );
        usageBillingAdmin = _usageBillingAdmin;
    }

    function setSessionReceiptContract(
        address _sessionReceiptContract
    ) public onlyOwner {
        sessionReceiptContract = _sessionReceiptContract;
    }

    function setNodesStorage(address _nodesStorage) public onlyOwner {
        require(_nodesStorage != address(0), "Invalid nodes storage address");
        nodesStorage = INodesStorage(_nodesStorage);
    }

    function addWhitelistedTokens(
        address[] calldata tokens
    ) external onlyOwner {
        for (uint256 i = 0; i < tokens.length; i++) {
            whitelistedTokens[tokens[i]] = true;
        }
    }

    function removeWhitelistedToken(address token) external onlyOwner {
        delete whitelistedTokens[token];
    }

    function purchaseUsage(
        LibUsageOrder.UsageOrder calldata usageOrder
    ) external payable nonReentrant {
        address client = usageOrder.client;
        uint256 requestedSeconds = usageOrder.requestedSeconds;
        uint256 totalPrice = usageOrder.totalPrice;
        TokenType tokenType = usageOrder.tokenType;
        address tokenAddress = usageOrder.tokenAddress;
        bytes memory usageBillingAdminSig = usageOrder.usageBillingAdminSig;
        uint256 nonce = usageOrder.nonce;

        require(whitelistedTokens[tokenAddress], "Token is not whitelisted");
        require(client == msg.sender, "Client is not the caller");
        require(
            requestedSeconds > 0,
            "Requested seconds must be greater than 0"
        );

        bytes32 digest = hashUsageOrder(usageOrder);
        address signer = ECDSA.recover(digest, usageBillingAdminSig);
        require(
            signer == usageBillingAdmin,
            "Signer is not usage billing admin"
        );

        require(nonce == nonces[msg.sender], "Invalid nonce");
        nonces[msg.sender]++;

        if (tokenType == TokenType.NATIVE) {
            require(tokenAddress == address(0), "Invalid native token address");
            require(msg.value == totalPrice, "Incorrect amount of native sent");
        } else {
            require(msg.value == 0, "Native token not accepted with ERC20");
            IERC20(tokenAddress).safeTransferFrom(
                msg.sender,
                address(this),
                totalPrice
            );
        }

        tokenBalances[tokenAddress] += totalPrice;
        clientUsages[msg.sender] += requestedSeconds;
        emit UsagePurchased(msg.sender, totalPrice, requestedSeconds);
    }

    function settleUsageToNode(
        address client,
        address node,
        uint256 totalServedUsage,
        address tokenAddress,
        uint256 totalToken
    ) external onlySessionReceiptContract nonReentrant {
        require(whitelistedTokens[tokenAddress], "Token is not whitelisted");
        require(nodesStorage.isValidNode(node), "Invalid node address");
        require(clientUsages[client] >= totalServedUsage, "Insufficient usage");

        require(
            tokenBalances[tokenAddress] >= totalToken,
            "Insufficient token balance"
        );

        clientUsages[client] -= totalServedUsage;
        tokenBalances[tokenAddress] -= totalToken;

        if (tokenAddress == address(0)) {
            (bool success, ) = node.call{value: totalToken}("");
            require(success, "Transfer failed");
        } else {
            IERC20(tokenAddress).safeTransfer(node, totalToken);
        }

        emit UsageSettledToNode(client, node, totalServedUsage, totalToken);
    }
}

